#include <stdio.h>
#include <stdbool.h>
#include <stdint.h>

bool canConstruct(char *ransomNote, char *magazine)
{
    // ASCII 97 TO 122
    uint32_t mmap[0x7F] = {0};
    uint32_t rmap[0x7F] = {0};

    while (*ransomNote)
    {
        rmap[*ransomNote]++;
        ransomNote++;
    }
    while (*magazine)
    {
        mmap[*magazine]++;
        magazine++;
    }

    for (int i = 1; i < 0x7F; i++)
    {
        if (rmap[i] > mmap[i])
            return false;
    }

    return true;
}

int main(void)
{
    char ransomNote[] = "";
    char magazine[] = "";

    printf("%d\n", canConstruct(ransomNote, magazine));
    return 0;
}